if(request_parameters["nextPage"] !== null && request_vendor_parameters["bookmark"] !== null) {
	var pagePath = request_vendor_path + '/' + request_vendor_parameters["bookmark"];
	request_vendor_parameters.remove("bookmark");

	return {
		"request_vendor_path": pagePath,
		"request_vendor_parameters": request_vendor_parameters
	}
}

var object = request_body_map;
object["Email"] = request_vendor_parameters["email"];
var contactObj = {};
contactObj["contact"] = object;

request_vendor_parameters["email"] = null;
return {
	"request_vendor_parameters": request_vendor_parameters,
	"request_vendor_body": contactObj
}

var customObj = {};
customObj["custom"] = request_body_map;
customObj["Email"] = request_vendor_parameters["email"];
var contactObj = {};
contactObj["contact"] = customObj;
request_vendor_parameters["email"] = null;

return {
	"request_vendor_parameters": request_vendor_parameters,
	"request_vendor_body": contactObj
}

if(request_parameters["nextPage"] !== null && request_vendor_parameters["bookmark"] !== null) {
	var pagePath = request_vendor_path + '/' + request_vendor_parameters["bookmark"];
	request_vendor_parameters.remove("bookmark");

	return {
		"request_vendor_path": pagePath,
		"request_vendor_parameters": request_vendor_parameters
	}
}

var underscore = events.event.indexOf("_");
var	objectType = null;
var	objectId = null;
var	eventType = null;
if(underscore > 0)
{
	objectType = events.event.substring(0, underscore);
	eventType = events.event.substring(underscore+1, events.event.length);
	if(eventType === "added")
		eventType = "CREATED";
	else if(eventType === "deleted")
		eventType = "DELETED";
	else
		eventType = "UPDATED";
	if(objectType === 'contact') {objectId = events['contact_id']; objectType = 'contacts';}
}
var eventRetVal = [
{
 "event_type" : eventType,
 "event_object_id" : objectId,
 "event_object_type" : objectType
}
];

return {
	"events" : eventRetVal
}
